The finale of my art fiesta - here it is 🧿

🧿 Never had I imagined I could pull of six days of art showings accompanied by #afternoonteas moving into #hightea &  then  lazy dinners at #Shamiana with the close ones :but  here it is 

I've shared many highlights here 🧿

🧿 Maybe the accolades & exposure led to a dark phase (which is why this late post) 

& Maybe we wouldn't be able to appreciate the light without the dark isn't it? And maybe the dark too holds its mysterious wins too!? 

🧿It was all so spectacular & well-received - the art- the presentation - the names i picked for each work- the art book I #authored 

