I #love #music #ancientart #contemporaryart #literature #design these are my inspirational drivers & to present them gives me great joy - a raisond'etre & meaning 

And my #friends #artcollectors #ateratti  on this day -  enjoyed the #Tchaikovsky as the backdrop to the #art i presented & sumptuous high tea by chef  Surendra Khambra & the entire spectacular #Taj team - 

My greatest joy is to use my experience as a curator is to present #artists who have packed opportunity to showcase their talent !

I'll cherish the conversations the joirdevivre the love and appreciation that flowed around on this special  evening always 🧿

