First day of our 'Art Fiesta'  #afternoontea 🧿 'Meanderings' at the The Taj Mahal Palace, Mumbai  had fabulous friends throng  our #ArtShowing of kaleidoscopic canvases by #LataBalakrishna 
It was a beautiful day at a historic gallery where greats like #FNsouza & #MFHusain had shown & the magic just continues 

The mix of Art with special friends is intoxicating isn't it? 

#Poets #ArtCollectors, #ArtLovers #Authors #Actors #MotivationalSpeaker #Designers 🧿 but most importantly all of them #closefriends whom i love

