Meanderings 

🧿 There was a magic in the air :my #artevening was  all that and more with music,  so many #beautiful #creative #colorful friends who made it a #magicalevening 🧿

🧿 There was an electric air to the evening & a lovely mix of friends  conversations  food and wines 🧿

🧿 What stayed with everyone was that ambience of warmth, excitement, exuberant energy enhanced moreso with the other #artists, #singers #actors #authors #designers #architects #composers #fashionistas that I have floated on the memory of that evening for a few days! 🧿

